/**
 * Applies signmoid function to each element in input vector.
 *
 * @param {float[]} x - input vector.
 * @return {float[]} output vector having applied the sigmoid function
 */
function sigmoid(x){
	for(var i = 0; i< x.length; i++){
		x[i] = 1/(1+Math.pow(Math.E, -x[i]));
	}
	return x
}

/**
 * Applies softmax function across all elements in input vector.
 *
 * @param {float[]} x - input vector.
 * @return {float[]} output vector having applied the softmax function
 */
function softmax(x){

	var max = Math.max(...x)
	var diffArr = x.map(function(a) { return a - max; });
	var expArr = diffArr.map(function(a) { return Math.exp(a); });
	
	var sum = expArr.reduce((a, b) => a + b, 0)
	var result = expArr.map(function(a) { return a/sum; });
	
	
	return result
}


